<script setup>
import LangSwitch from "@components/LangSwitch.vue";
import AccountInpGroup from "@components/Account/InpGroup.vue";
import AccountInput from "@components/Account/Input.vue";
import AccountCheckbox from "@components/Account/Checkbox.vue";
import AccountSubtitle from "@components/Account/Subtitle.vue";
import FeedbackAlert from "@components/Feedback/Alert.vue";
import { fetchAPI } from "@utils/api.js";
import { computed, onMounted, reactive } from "vue";

const setup = reactive({
  username: "",
  pw: "",
  pwCheck: "",
  sslCheck: false,
  servInp: "",
  hostInp: "",
  urlInp: "",
  servDNSIsOn: null,
  showLoader: true,
  resume: computed(() => {
    return `http${setup.sslCheck ? "s" : ""}://${setup.servInp}${setup.urlInp}`;
  }),
  servDNSPath: computed(() => {
    return `http${setup.sslCheck ? "s" : ""}://${setup.servInp}/setup/check`;
  }),
  canSubmit: computed(() => {
    if (
      !setup.username ||
      !setup.pw ||
      !setup.pwCheck ||
      !setup.servInp ||
      !setup.urlInp ||
      setup.pw !== setup.pwCheck
    )
      return false;
    return true;
  }),
});

const sendData = reactive({
  isPend: false,
  isErr: false,
  data: [],
});

async function startSetup() {
  if (!setup.canSubmit) return;
  // Prepare data
  const data = {
    username: setup.username,
    password: setup.pw,
    password_check: setup.pwCheck,
    ui_host: setup.hostInp,
    ui_url: setup.urlInp,
    server_name: setup.servInp,
    lets_encrypt: setup.sslCheck ? "yes" : "no",
  };

  setup.showLoader = true;

  // Send
  await fetchAPI(window.location.href, "POST", data, sendData, null)
    .then((res) => {
      if (res.type === "success") {
        setTimeout(() => {
          window.open(`${setup.resume}/login`, "_self");
        }, 60000);
        setInterval(() => {
          fetch(`${setup.resume}/check`, {
            cache: "no-cache",
          })
            .then((res) => {
              res.status === 200
                ? window.open(`${setup.resume}/login`, "_self")
                : null;

              setupErr();
            })
            .catch((err) => {
              setupErr();
            });
        }, 5000);
      } else {
        setupErr();
      }
    })
    .catch((err) => {
      setupErr();
    });
}

function checkServDNS() {
  fetch(setup.servDNSPath)
    .then((res) => {
      setup.servDNSIsOn = res.status === 200 ? true : false;
    })
    .catch((err) => {
      setup.servDNSIsOn = false;
    });
}

function setupErr() {
  // Start hiding loader, then show error msg
  setTimeout(() => {
    setup.showLoader = false;
    setup.setupErr = true;
    setTimeout(() => {
      setup.setupErr = false;
    }, 5000);
  }, 400);
}

onMounted(() => {
  class Loader {
    constructor() {
      this.logoEl = document.querySelector("[data-loader-img]");
      this.loaderEl = document.querySelector("[data-loader]");
      this.isLoading = true;
      this.init();
    }

    init() {
      this.loading();
      setTimeout(() => {
        this.loaderEl.classList.add("opacity-0");
      }, 1350);

      setTimeout(() => {
        setup.showLoader = false;
      }, 1650);
    }

    loading() {
      if ((this.isLoading = true)) {
        setTimeout(() => {
          this.logoEl.classList.toggle("scale-105");
          this.loading();
        }, 300);
      }
    }
  }

  const setLoader = new Loader();
});
</script>

<template>
  <div
    v-show="setup.showLoader"
    data-loader
    role="alert"
    class="loader-container"
  >
    <p class="sr-only">
      {{ $t(`setup_loader_${setup.trySetup ? "default" : "setup"}`) }}
    </p>
    <img
      data-loader-img
      src="data:image/png;base64,"
      class="loader-container-img"
      :alt="$t('setup_logo_alt')"
    />
  </div>
  <LangSwitch />
  <div class="account-alert-container">
    <FeedbackAlert
      @close="setup.setupErr = false"
      id="account-error"
      type="error"
      status="500"
      :message="$t('setup_failed')"
      v-if="setup.setupErr"
    />
  </div>
  <main class="grid grid-cols-2 align-middle items-center min-h-screen">
    <!--form -->
    <div
      class="mx-4 lg:mx-0 col-span-2 h-full flex flex-col items-center justify-center"
    >
      <div class="my-8 bg-gray-50 rounded px-4 pt-10 pb-4 w-full max-w-[550px]">
        <div class="flex justify-center">
          <img
            class="max-w-60 max-h-30 mb-6"
            :alt="$t('setup_logo_alt')"
            src="data:image/png;base64,"
          />
        </div>
        <h1 class="block text-center font-bold text-3xl">
          {{ $t("setup_title") }}
        </h1>
        <form
          @submit.prevent
          class="grid grid-cols-12 md:gap-x-6 justify-items-center"
          id="setup-form"
          action="setup"
          method="POST"
          autocomplete="off"
        >
          <AccountSubtitle :title="$t('setup_account')" />
          <!-- username inpt-->
          <AccountInpGroup>
            <AccountInput
              @inp="(e) => (setup.username = e)"
              :label="$t('setup_username')"
              name="username"
              pattern="(.*?)"
              :placeholder="$t('setup_username_placeholder')"
              type="text"
              :required="true"
            />
          </AccountInpGroup>
          <!-- end username inpt-->
          <!-- password inpt-->
          <AccountInpGroup>
            <AccountInput
              @inp="(e) => (setup.pw = e)"
              :label="$t('setup_password')"
              name="password"
              pattern="(.*?)"
              :placeholder="$t('setup_password_placeholder')"
              type="password"
              :required="true"
            />
          </AccountInpGroup>
          <!-- end password inpt-->
          <!-- password inpt-->
          <AccountInpGroup>
            <AccountInput
              @inp="(e) => (setup.pwCheck = e)"
              :label="$t('setup_password_check')"
              name="password_check"
              pattern="(.*?)"
              :placeholder="$t('setup_password_check_placeholder')"
              type="password"
              :required="true"
              :isInvalid="setup.pw !== setup.pwCheck ? true : false"
              :invalidText="$t('setup_password_check_invalid')"
            />
          </AccountInpGroup>
          <!-- end password inpt-->
          <AccountSubtitle :title="$t('setup_settings')" />

          <!-- ui host-->
          <AccountInpGroup>
            <AccountInput
              :label="$t('setup_ui_host')"
              @inp="(e) => (setup.hostInp = e)"
              name="ui_host"
              pattern="^https?:\/\/.{1,255}(:((6553[0-5])|(655[0-2][0-9])|(65[0-4][0-9]{2})|(6[0-4][0-9]{3})|([1-5][0-9]{4})|([0-5]{0,5})|([0-9]{1,4})))?$"
              :placeholder="$t('setup_ui_host_placeholder')"
              type="text"
              :required="true"
            />
          </AccountInpGroup>
          <!-- end ui host-->
          <!-- ui url-->
          <AccountInpGroup>
            <AccountInput
              @inp="(e) => (setup.urlInp = e)"
              :label="$t('setup_ui_url')"
              name="ui_url"
              pattern="\/(.*[a-z])"
              :placeholder="$t('setup_ui_url_placeholder')"
              type="text"
              :required="true"
            />
          </AccountInpGroup>
          <!-- end ui url-->
          <!-- server name-->
          <AccountInpGroup>
            <AccountInput
              @inp="
                (e) => {
                  setup.servDNSIsOn = null;
                  setup.servInp = e;
                }
              "
              :label="$t('setup_server_name')"
              name="server_name"
              pattern=".*"
              :placeholder="$t('setup_server_name_placeholder')"
              type="text"
              :value="$t('setup_server_name_value')"
              :required="true"
            />
          </AccountInpGroup>
          <!-- end server name-->

          <!-- auto let's encrypt-->
          <AccountInpGroup>
            <AccountCheckbox
              @inp="(e) => (setup.sslCheck = e === 'yes' ? true : false)"
              :label="$t('setup_lets_encrypt')"
              name="lets_encrypt"
              value="no"
              :required="true"
            />
          </AccountInpGroup>
          <!-- end auto let's encrypt-->
          <AccountInpGroup>
            <label id="check-dns" class="account-label">
              {{ $t("setup_check_dns") }}
            </label>
            <div class="flex justify-center items-center">
              <button
                role="checkbox"
                aria-labelledby="check-dns"
                :aria-checked="setup.servDNSIsOn === null ? 'false' : 'true'"
                @click.prevent="checkServDNS()"
                id="check-server-name"
                class="flex justify-start w-fit tracking-wide inline-block px-6 py-3 font-bold text-center text-white uppercase align-middle transition-all rounded-lg cursor-pointer bg-primary hover:bg-primary/80 focus:bg-primary/80 leading-normal text-xs ease-in shadow-xs bg-150 bg-x-25 hover:-translate-y-px active:opacity-85 hover:shadow-md"
              >
                <span>{{ $t("setup_check_dns_button") }}</span>
                <span
                  :aria-description="$t('setup_check_dns_color_desc')"
                  :class="[
                    setup.servDNSIsOn === null
                      ? 'bg-gray-300'
                      : setup.servDNSIsOn
                        ? 'bg-green-500'
                        : 'bg-red-500',
                  ]"
                  class="block ml-2 rounded-full w-4 h-4"
                ></span>
                <span class="sr-only">
                  {{
                    $t(
                      `setup_check_dns_result_${
                        setup.servDNSIsOn === null
                          ? "unknown"
                          : setup.servDNSIsOn
                            ? "success"
                            : "error"
                      }`,
                    )
                  }}
                </span>
              </button>
            </div>
          </AccountInpGroup>
          <div
            class="p-2 col-span-12 bg-gray-200 mt-4 md:mt-6 mb-1 py-2 px-2 rounded flex flex-col justify-center items-center w-full max-w-[400px] overflow-hidden"
          >
            <h3
              class="text-sm md:text-base text-center mt-1 mb-2 transition duration-300 ease-in-out text-md font-bold m-0"
            >
              {{ $t("setup_final_url") }}
            </h3>
            <p
              class="family-text text-center text-sm md:text-base break-words w-full px-4"
            >
              {{ setup.resume }}
            </p>
          </div>
          <div
            class="mt-4 col-span-12 flex flex-col justify-center items-center"
          >
            <button
              @click.prevent="startSetup()"
              type="submit"
              id="setup-button"
              name="setup-button"
              :disabled="!setup.canSubmit"
              class="btn btn-normal"
            >
              {{ $t("setup_button") }}
            </button>
            <strong
              v-show="!setup.canSubmit"
              role="alert"
              :aria-hidden="setup.canSubmit ? 'true' : 'false'"
              class="font-normal text-sm text-red-500 text-center mt-1"
            >
              {{ $t("setup_form_invalid_submit") }}
            </strong>
          </div>
        </form>
      </div>
    </div>
    <!-- end form -->
  </main>
</template>
